import React, { useState, useEffect } from "react";

export const ChartComponent = ({ chartData }) => {
  return (
    <div style={{ width: "800px" }}>
      <Chart
        type={chartData.type}
        options={chartData.options}
        series={chartData.series}
        width="100%"
      />
    </div>
  );
};
